95f70258d33b0b5d15d42fb18dbf87f7eb0abf4a:
query GetCompany($id: ID!) {
  getCompany(id: $id) {
    id
    attributes {
      field {
        description
        id
        name
      }
      value {
        stringValue
        booleanValue
        dateValue
        emailValue
        floatValue
        intValue
        ipAddressValue
        phoneValue
        jsonValue
        timeValue
        timestampValue
        urlValue
        dateTimeValue
      }
    }
    documentCollections {
      name
      id
    }
  }
}

c3737e42108c42e703fae993722a47bd2de7dd6c:
query GetDocumentCollection($id: ID!) {
  getDocumentCollection(id: $id) {
    chats {
      id
    }
    name
    documents {
      id
      name
    }
    id
  }
}

072f19d8835c6ef25fdf4c1356fcedd7619e3a3c:
query GetInvestingEntities {
  getInvestingEntities {
    address
    entityType
    id
    name
    strategy
    users {
      email
      id
    }
  }
}

afc611b406dd4a083a74e81ab958dee49e133d8f:
query GetInvestingEntity($id: ID!) {
  getInvestingEntity(id: $id) {
    address
    companies {
      documents {
        name
        downloadUrl
        id
      }
      attributes {
        field {
          description
          id
          name
        }
        value {
          stringValue
        }
      }
      id
    }
    entityType
    name
    strategy
    investmentCriteria {
      required
    }
    id
  }
}

605e8161a4d675a31b97dc3831e5caf14ee4e519:
query GetUser($id: ID!) {
  getUser(id: $id) {
    email
    id
    investingEntities {
      name
      address
      entityType
      strategy
      id
      companies {
        id
        attributes {
          field {
            id
            name
            description
          }
          value {
            stringValue
          }
        }
      }
    }
  }
}

